import './App.css';
import {Route, Routes, BrowserRouter} from 'react-router-dom'
import Home from './components/Home';
import Header from './components/Header';

function App() {
  return (
    <BrowserRouter>
    <div>
    <Header />
    <Routes>
      <Route element={ <Home/> } exact path="/"/>
      </Routes>
    </div>
    </BrowserRouter>

  );
}

export default App;
